        return da;
    }




    //教务管理SQL
    public static string conStrdjks = ConfigurationManager.ConnectionStrings["djksConnectionString"].ConnectionString;
    /// <summary>
    /// 执行查询
    /// </summary>
    /// <param name="sql">查询语句</param>
    /// <param name="parameters">查询参数</param>
    /// <returns></returns>
    public static DataTable djksSerach(string sql, params SqlParameter[] parameters)
    {
        //建立连接
        using (SqlConnection conn = new SqlConnection(conStrdjks))
        {
            //打开连接
            try
            {
                conn.Open();
                using (SqlCommand cmd = conn.CreateCommand())
                {
                    cmd.CommandText = sql;
                    foreach (SqlParameter parameter in parameters)
                    {
                        cmd.Parameters.Add(parameter);
                    }
                    DataSet st = new DataSet();
                    SqlDataAdapter adapter = new SqlDataAdapter(cmd);
                    adapter.Fill(st);
                    return st.Tables[0];
                }

            }
            catch (Exception e)
            {
                return new DataTable();
            }
        }
    }
    /// <summary>
    /// 执行ExcuteNonQuery操作
    /// </summary>
    /// <param name="sql">执行sql语句</param>
    /// <param name="parameters">相关参数</param>
    /// <returns>影响行数</returns>
    public static int djksExcuteNonQuery(String sql, params SqlParameter[] parameters)
    {
        try
        {
            using (SqlConnection conn = new SqlConnection(conStrdjks))
            {
                conn.Open();
                using (SqlCommand cmd = new SqlCommand(sql, conn))
                {
                    foreach (SqlParameter parameter in parameters)
                    {
                        object o = parameter.Value;
                        cmd.Parameters.Add(parameter);
                    }


                    return cmd.ExecuteNonQuery();
                }
            }
        }
        catch (Exception e)
        {
            return 0;
        }
    }
